  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0139515 includes physical
  and profile data collected aboard the Bay Hydro II during project S-D927-BH2-15
  from 2015-10-20 to 2015-10-22. These data include CONDUCTIVITY, HYDROSTATIC PRESSURE,
  SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD. These data were collected and submitted by the
  NOAA Office of Coast Survey in support of hydrographic multibeam surveys to meet
  NOAA charting requirements.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
